import React from 'react'

function Popup(node) {
  const classes = useStyles();
 const [modalStyle] = React.useState(getModalStyle);
 const [open, setOpen] = React.useState(false);

 const handleOpen = () => {
     setOpen(true);
 };

 const handleClose = () => {
     setOpen(false);
 };
  return (
    console.log(node.name),
<p>node.name</p>
)
}

export default Popup;
